import React from 'react';
import Logo from '../Images/MehndiLogo.png';

function Header(){
    return <div>
        <section>
            <img className="Logo" src={Logo} height={200} width={200} alt="Logo Image" />
        </section>
    </div>
           
        
}

export default Header;
